import "./subject.css"
const Subject = (props) => {
    const subjects = props.subject;
    return(
        <div>
             <div className="subList">
     {subjects.map((sub, index) => (
                <div key={index} className="subName" style={{color:"#FFFF"}}>{sub}</div>
              ))}
        </div>
        </div>
       
    )
}
export default Subject;
